DROP TABLE IF EXISTS `orderitem`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `orderitem` (
  `orderId` int(10) unsigned NOT NULL,
  `productId` int(10) unsigned NOT NULL,
  `quantity` decimal(10,2) unsigned NOT NULL DEFAULT 1.00,
  `price` decimal(10,2) unsigned NOT NULL DEFAULT 0.00,
  `discount` decimal(10,2) unsigned NOT NULL DEFAULT 0.00,
  `tax` decimal(10,2) unsigned NOT NULL DEFAULT 0.00,
  `active` tinyint(1) NOT NULL DEFAULT 1,
  `isAvailable` tinyint(1) NOT NULL DEFAULT 1,
  `created` timestamp NOT NULL DEFAULT current_timestamp(),
  `modified` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  UNIQUE KEY `orderId` (`orderId`,`productId`),
  KEY `productId` (`productId`),
  CONSTRAINT `orderitem_ibfk_1` FOREIGN KEY (`productId`) REFERENCES `product` (`productId`),
  CONSTRAINT `orderitem_ibfk_2` FOREIGN KEY (`orderId`) REFERENCES `shoppingorder` (`orderId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_general_ci;
