CREATE DEFINER=`root`@`localhost` PROCEDURE `CUSTOMER`(
	IN inAction INT,
	IN inCustomerId INT, 
	IN inEmail VARCHAR(100),
	IN inPhone VARCHAR(100),
	IN inFname VARCHAR(100),
	IN inLname VARCHAR(255),
	IN inIsActive TINYINT, -- default
	IN inIsVerified TINYINT, 
	IN inResetPass TINYINT, 
	IN inPass VARCHAR(255),
	IN inCode VARCHAR(255),
	IN inTypeId INT,
	IN inAdminId INT, 
	IN inLocale VARCHAR(255),
	IN inLatitude DOUBLE,
	IN inLongitude DOUBLE,
	IN inPassExpire DATETIME,
	IN inStartDate DATETIME,
	IN inEndDate DATETIME,
	IN inStart INT, 
	IN inLimit INT 
)
PROC: BEGIN

	DECLARE dPhone,dEmail,dECode,dFname,uniqueId VARCHAR(255) DEFAULT NULL;
	DECLARE dCode,dCustomerId INT DEFAULT NULL;
    -- DECLARE dTime DATETIME DEFAULT NULL;
    
    DECLARE dRollBack BOOL DEFAULT 0;
    DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET dRollBack = 1;     

	CASE inAction
		-- create customer		
		WHEN 1 THEN
            SET inEmail = ValidString(inEmail);
            SET inPhone = ValidString(inPhone);
            SET inFname = ValidString(inFname);
            SET inLname = ValidString(inLname);
            SET inPass = ValidString(inPass);
            -- SET inCode = ValidString(inCode);
            
			IF EXISTS(select 1 from customer where phone = inPhone or email = inEmail) THEN
				SELECT email INTO dEmail FROM customer WHERE email = inEmail;
				SELECT phone INTO dPhone FROM customer WHERE phone = inPhone;
				SELECT 'The customer already exists' message, dPhone phone, dEmail email, 0 created, dCustomerId customerId;
				LEAVE PROC;
            END IF;
            
            SET uniqueId = FLOOR(RAND() * NOW()) + 100000;
            -- if identifier exists, resubmit it again
            -- select uniqueId,inEmail,inPhone,inFname,inLname,inPass,inCode,inTypeId; leave proc;
			INSERT INTO customer(uniqueId,email,phone,fname,lname,pass,vCode)
			VALUE(uniqueId,inEmail,inPhone,inFname,inLname,inPass,inCode);
			
			SELECT LAST_INSERT_ID() customerId, ROW_COUNT() created, uniqueId identifier;
            LEAVE PROC;
            
        -- verify customer
		WHEN 2 THEN
            SET inEmail = ValidString(inEmail);
            SET inPhone = ValidString(inPhone);
            -- SET inCode = ValidString(inCode);
            -- select inEmail,inPhone,inCode; leave proc;
            UPDATE customer SET verified = 1, vCode = null
            -- select * from customer
            WHERE
				verified = 0
				AND vCode = inCode
                -- AND if(inEmail,email=inEmail,1)
                -- AND if(inPhone,phone=inPhone,1);
                -- AND (email = inEmail OR phone = inPhone);
                AND email = inEmail 
                AND phone = inPhone;
			SELECT ROW_COUNT() updated;
			LEAVE PROC;
            
		-- list of customers using filter
        WHEN 3 THEN
            SET inEmail = ValidString(inEmail);
            SET inPhone = ValidString(inPhone);
            -- select inEmail,inPhone,inCustomerId,inIsActive,inIsVerified; leave proc;
			SELECT c.customerId, c.uniqueId, c.email, c.phone, c.fname, c.lname, c.pass, ct.typeId, ct.type, a.longitude, a.latitude
			FROM customer c
			JOIN customertype ct ON ct.typeId = c.customertypeId
            JOIN addresses a ON a.customerId = c.customerId
			WHERE
				/*(inCustomerId IS NULL OR c.customerId = inCustomerId)
				AND (inEmail IS NULL OR c.email = inEmail)
				AND (inPhone IS NULL OR c.phone = inPhone)*/
                if(inCustomerId,c.customerId = inCustomerId,1)
                AND if(inEmail,c.email = inEmail,1)
                AND if(inPhone,c.phone = inPhone,1)
                AND if(inIsVerified,c.verified = inIsVerified,1)
                AND if(inIsActive,c.active = inIsActive,1)
			ORDER BY c.customerId DESC
			LIMIT inStart,inLimit;
			LEAVE PROC;
            
		-- forgot password
        WHEN 4 THEN
            SET inEmail = ValidString(inEmail);
            SET inPhone = ValidString(inPhone);
            
            SELECT customerId,fname,email,phone INTO dCustomerId,dFname,dEmail,dPhone
            FROM customer 
            WHERE 
				email = inEmail OR phone = inPhone
				AND active = 1
				AND verified = 1;            
            
			UPDATE customer SET passreset = 1, vCode = inCode WHERE customerId = dCustomerId; 

			SELECT dFname fname,dEmail email,dPhone phone, ROW_COUNT() updated;
			LEAVE PROC;
            
		-- reset password
        WHEN 5 THEN
            SET inEmail = ValidString(inEmail);
            SET inPhone = ValidString(inPhone);
            
			UPDATE customer SET passreset = null, vCode = null, pass = inPass
			WHERE 
				(email = inEmail OR phone = inPhone)
				AND active = 1
				AND verified = 1
                AND passreset = 1
                AND vCode = inCode;

			SELECT ROW_COUNT() updated;
			LEAVE PROC;
            
		-- list of customer types
        WHEN 6 THEN
			SELECT typeId,type,created FROM customertype LIMIT 100;
			LEAVE PROC;
            
		-- customer new address
        WHEN 7 THEN -- select inCustomerId,inFname,inLname,inEmail,inPhone,inLatitude,inLongitude,inIsActive,inLocale; leave proc;
			INSERT INTO addresses(customerId,fname,lname,email,phone,latitude,longitude,defaultAddress,locale)
            VALUE(inCustomerId,inFname,inLname,inEmail,inPhone,inLatitude,inLongitude,inIsActive,inLocale);
            SELECT LAST_INSERT_ID() id, 1 created;
			LEAVE PROC;
            
		-- customer addresses
        WHEN 8 THEN
			SELECT addressId, fname, lname, email, phone, latitude, longitude, defaultAddress 
            FROM addresses
            WHERE
				customerId = inCustomerId
                AND IF(inIsActive,defaultAddress = 1,1)
			ORDER BY created DESC
			LIMIT inStart, inLimit;
			LEAVE PROC;
            
		-- update customer details
        WHEN 9 THEN
            SET inEmail = ValidString(inEmail);
            SET inPhone = ValidString(inPhone);
            SET inFname = ValidString(inFname);
            SET inLname = ValidString(inLname);
            
			UPDATE customer 
				SET email = inEmail, phone = inPhone, fname = inFname, lname = inLname
			WHERE 
				customerId = inCustomerId;

			SELECT ROW_COUNT() updated;
			LEAVE PROC;
            
		-- login
        WHEN 10 THEN
            SET inEmail = ValidString(inEmail);
            SET inPhone = ValidString(inPhone);
            -- select inEmail,inPhone,inCustomerId,inIsActive,inIsVerified; leave proc;
			SELECT c.customerId, c.uniqueId, c.email, c.phone, c.fname, c.lname, c.pass, c.isAdmin
			FROM customer c
			WHERE
				(inCustomerId IS NULL OR c.customerId = inCustomerId)
				AND (inEmail IS NULL OR c.email = inEmail)
				AND (inPhone IS NULL OR c.phone = inPhone)
			LIMIT 1;
			LEAVE PROC; 

		ELSE
			SELECT 'Out of actions' denoted;
            LEAVE PROC; 
        
	END CASE;

END ;;
DELIMITER ;
