CREATE DEFINER=`root`@`localhost` PROCEDURE `EORDER`(
    IN inAction INT,
    IN inCartId INT,
    IN inOrderId INT,
    IN inProductId INT,
    IN inQty INT,
    IN inCustomerId INT,
    IN inAdminId INT,
    IN inAdressId INT,
    IN inIsActive TINYINT,
    IN inPrice INT, 
    IN inDiscount INT,
    IN inTax INT, 
    IN inShippingFee INT, 
    IN inPaymentModeId INT, 
    IN inPaymentId INT, 
    IN inStartDate DATETIME,
    IN inEndDate DATETIME,
    IN inStart INT,
    IN inLimit INT
)
PROC: BEGIN

    DECLARE dCartId, dOrderId INT;
    
    DECLARE dRollBack BOOL DEFAULT 0;
    DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET dRollBack = 1;	    

    CASE inAction
        -- Create cart
        WHEN 1 THEN
			-- UPDATE cart SET active = 0 WHERE customerId = inCustomerId;
            INSERT INTO cart(customerId)
            VALUE(inCustomerId)
            ON DUPLICATE KEY UPDATE cartId = LAST_INSERT_ID(cartId);
            SELECT last_insert_id() cartId;
            LEAVE PROC;
            
		-- Insert cart items
        WHEN 2 THEN
			-- INSERT cartitem(cartId,productId,quantity,price,discount,tax,created)
			-- VALUE(inCartId,inProductId,inQty,inPrice,inDiscount,inTax,inStartDate);
			INSERT INTO cartitem (cartId, productId, quantity, price, discount, tax, created)
			VALUES (inCartId, inProductId, inQty, inPrice, inDiscount, inTax, inStartDate)
			ON DUPLICATE KEY UPDATE
				quantity = VALUES(quantity),
				price = VALUES(price),
				discount = VALUES(discount),
				tax = VALUES(tax);
            SELECT ROW_COUNT() created;
			LEAVE PROC;
            
		-- View cart items
        WHEN 3 THEN
			SELECT p.productId, p.product, ci.quantity qty, ci.price, ci.discount, ci.tax, p.sku, i.imageId, i.img
			FROM cartitem ci
            JOIN cart c ON c.cartId = ci.cartId
			JOIN product p ON p.productId = ci.productId
			JOIN images i ON i.productId = p.productId
			WHERE
				c.customerId = inCustomerId
                -- AND ci.active = 
			LIMIT 20;
			LEAVE PROC;
            
		-- Remove item from cart
        WHEN 4 THEN
			DELETE FROM cartitem 
            WHERE
				cartId = inCartId
                AND productId = inProductId;
			LEAVE PROC;
            
		-- Create order
        WHEN 5 THEN
			SELECT cartId INTO dCartId 
            FROM cart 
            WHERE 
				cartId = (select cartId from cart where customerId = inCustomerId);
                
			-- Check if cartitem is empty, then exit the procedure
			IF (select count(productId) from cartitem where cartId = dCartId) = 0 THEN
				SELECT 0 created, 'empty cart' message;
				LEAVE PROC;
			END IF;            
            
			START TRANSACTION;
				INSERT INTO shoppingorder(customerId,addressId,paymentModeId,shipping)
				VALUE(inCustomerId,inAdressId,inPaymentModeId,inShippingFee);

				SET inOrderId = LAST_INSERT_ID();

				-- Get items from cart
				INSERT INTO orderitem(orderId,productId,quantity,price,discount,tax)
				SELECT inOrderId,productId,quantity,price,discount,tax
				FROM cartitem
				WHERE
					cartId = dCartId
					AND active = 1
					AND isAvailable = 1;

				-- Remove the items from cart
				DELETE FROM cartitem WHERE cartId = dCartId;
                
                -- Update order details with summary
				UPDATE shoppingorder o
				JOIN (
					SELECT 
						orderId,
						SUM(quantity * price) AS subtotal,
						SUM(discount) AS total_discount,
						SUM(tax) AS total_tax
					FROM orderitem
					WHERE active = 1
					GROUP BY orderId
				) oi ON o.orderId = oi.orderId
				SET 
					o.subtotal = oi.subtotal,
					o.discount = oi.total_discount,
					o.tax = oi.total_tax,
					o.total = oi.subtotal - oi.total_discount + oi.total_tax + o.shipping -- + o.weighting
				WHERE o.orderId = inOrderId;

			IF dRollBack THEN
				ROLLBACK;
				SELECT 'Technical problem' message, 0 created;
			ELSE 
				COMMIT;	
				SELECT 1 created, inOrderId orderId, dCartId cartId;
			END IF;             
			LEAVE PROC;
            
        -- Add items into the order
        WHEN 6 THEN
			LEAVE PROC;
            
		-- Orders details
        WHEN 7 THEN
			SELECT orderId, addressId, subtotal, discount, tax, shipping, total, created
            FROM shoppingorder
            WHERE
				if(inOrderId, orderId = inOrderId, 1)
                and if(inCustomerId, customerId = inCustomerId, 1)
			ORDER BY orderId DESC
			LIMIT inStart, inLimit;
			LEAVE PROC;

        -- Default case for unknown actions
        ELSE
            SELECT 'Out of actions' message;
            LEAVE PROC;

    END CASE;

END ;;
DELIMITER ;
