CREATE DEFINER=`root`@`localhost` PROCEDURE `PRODUCT`(
    IN inAction INT,
    IN inProductId INT,
    IN inProduct VARCHAR(200),
    IN inDescp VARCHAR(1000),
    IN inSEOtitle VARCHAR(500),
    IN inMetaDescrp VARCHAR(1000),
    IN inCategoryId INT,
    IN inVeiwId INT, -- Assuming this is 'viewId'
    IN inSku VARCHAR(100),
    IN inImgs JSON, -- Correct parameter name for JSON array of image paths
    IN inCustomerId INT,
    IN inAdminId INT,
    IN inIsActive TINYINT,
    IN inPrice DOUBLE,
    IN inDiscount DOUBLE,
    IN inTax DOUBLE,
    IN inOStock DOUBLE,      -- Opening Stock
    IN inCStock DOUBLE,      -- Current/Closing Stock (assuming one parameter for both)
    IN inTypeId INT,
	IN inLatitude DOUBLE,
	IN inLongitude DOUBLE,    
    IN inStartDate DATETIME,
    IN inEndDate DATETIME,
    IN inStart INT,
    IN inLimit INT
)
PROC: BEGIN

    -- Declare variables for product ID and image loop
    DECLARE dProductId INT; -- Using 'v_product_id' for clarity
    DECLARE i INT DEFAULT 0;
    DECLARE image_count INT;
    DECLARE dImage VARCHAR(255); -- Renamed 'img' to 'current_image_path' for clarity

    -- Declare the exception handler at the beginning of the BEGIN block
    -- This ensures that any SQLEXCEPTION (e.g., insert error) triggers a rollback


    CASE inAction
        -- Action 1: Create Product
        WHEN 1 THEN
			-- select inCStock;  leave proc;
            START TRANSACTION;
            
				INSERT INTO product(product, descrp, seo_title, meta_descrp, categoryId, viewId, sku, customerId, isActive, price, discount, tax, stock, closingStock)
				VALUES(inProduct, inDescp, inSEOtitle, inMetaDescrp, inCategoryId, inVeiwId, inSku, inCustomerId, inIsActive, inPrice, inDiscount, inTax, inCStock, inCStock);
				SET dProductId = LAST_INSERT_ID();

            -- Process the JSON array of image paths and insert them into the images table
            SET image_count = JSON_LENGTH(inImgs); -- Use 'inImgs' parameter

            WHILE i < image_count DO
                SET dImage = JSON_UNQUOTE(JSON_EXTRACT(inImgs, CONCAT('$[', i, ']'))); -- Use 'inImgs' parameter

                -- Insert the image path associated with the current product ID
                INSERT INTO images(productId, img)
                VALUES (dProductId, dImage); -- Use 'v_product_id'

                SET i = i + 1;
            END WHILE;

            COMMIT; -- Commit the transaction if all insertions are successful

            -- Return the newly inserted product ID and a success indicator
            SELECT dProductId productId, 1 created;
            LEAVE PROC;

        -- Action 2: Update Product
        WHEN 2 THEN
				UPDATE 
					product
				SET 
					product = inProduct, 
                    descrp = inDescp, 
                    seo_title = inSEOtitle, 
                    meta_descrp = inMetaDescrp, 
                    categoryId = inCategoryId, 
                    viewId = inVeiwId, 
                    sku = inSku, 
                    isActive = inIsActive, 
                    price = inPrice, 
                    discount = inDiscount, 
                    tax = inTax, 
                    stock = inCStock, 
                    closingStock = inCStock
				WHERE
					customerId = inCustomerId
                    AND productId = inProduct;
				SELECT ROW_COUNT() updated;
        
            -- Add your UPDATE logic here
            -- Example:
            -- UPDATE product
            -- SET
            --    product = inProduct,
            --    descrp = inDescp,
            --    seo_title = inSEOtitle,
            --    meta_descrp = inMetaDescrp,
            --    categoryId = inCategoryId,
            --    viewId = inVeiwId,
            --    sku = inSku,
            --    isActive = inIsActive,
            --    price = inPrice,
            --    discount = inDiscount,
            --    tax = inTax,
            --    openingStock = inOStock,
            --    stock = inCStock,
            --    closingStock = inCStock
            -- WHERE productId = inProductId;

            -- Optionally, handle image updates (delete old, insert new, or update existing)
            -- DELETE FROM images WHERE productId = inProductId;
            -- SET image_count = JSON_LENGTH(inImgs);
            -- SET i = 0;
            -- WHILE i < image_count DO
            --    SET current_image_path = JSON_UNQUOTE(JSON_EXTRACT(inImgs, CONCAT('$[', i, ']')));
            --    INSERT INTO images(productId, img) VALUES (inProductId, current_image_path);
            --    SET i = i + 1;
            -- END WHILE;

            -- SELECT inProductId AS productId, ROW_COUNT() AS updated_rows;
            LEAVE PROC;

        -- Action 3: List of products using filter
        WHEN 3 THEN
			SELECT p.productId, p.product, i.img, MIN(i.imageId) imageId, p.descrp, c.categoryId, c.category, p.sku, p.isActive,
					p.price, p.discount, p.closingStock stock, p.created,
					-- Calculate distance in meters using ST_Distance_Sphere()
					ST_Distance_Sphere(
						POINT(a.longitude, a.latitude),
						POINT(inLongitude, inLatitude)
					) / 1000 km                    
			FROM product p
			JOIN images i ON i.productId = p.productId
			JOIN category c ON c.categoryId = p.categoryId
            JOIN addresses a ON a.customerId = p.customerId
			WHERE
				p.viewId = inVeiwId
				AND (inCategoryId IS NULL OR c.categoryId = inCategoryId)
				AND (inCustomerId IS NULL OR p.customerId = inCustomerId)
                AND p.closingStock > 0
                AND a.defaultAddress = 1
			GROUP BY
				p.productId, p.product, p.descrp, c.categoryId, c.category, km,
				p.sku, p.isActive, p.price, p.discount, p.closingStock, p.created
			ORDER BY 
				km ASC, -- Order by distance, closest first
				p.created DESC
			LIMIT inStart, inLimit;
            LEAVE PROC;

        -- Action 4: Details of a product
        WHEN 4 THEN
            -- Select main product details
            SELECT
                p.productId,
                p.product,
                p.descrp,
                p.seo_title, -- Added for completeness
                p.meta_descrp, -- Added for completeness
                c.categoryId,
                c.category,
                p.sku,
                p.closingStock AS stock,
                p.isActive,
                p.price,
                p.discount,
                p.tax,
                p.created
            FROM product p
            JOIN category c ON c.categoryId = p.categoryId
            WHERE
                p.productId = inProductId
            LIMIT 1;

            -- Select all images for the product
            SELECT
                imageId,
                -- title, descrp, -- If these columns exist in 'images' table
                img,
                isActive, -- If 'isActive' exists in 'images' table
                -- defaultImg, -- If 'defaultImg' exists in 'images' table
                created
            FROM images
            WHERE
                productId = inProductId;
            LEAVE PROC;

        -- Action 5: Products list for an account (similar to Action 3 but potentially different filters)
        WHEN 5 THEN
            SELECT
                p.productId,
                p.product,
                p.seo_title,
                p.meta_descrp,
                p.descrp,
                c.categoryId,
                c.category,
                p.sku,
                p.isActive,
                p.price,
                p.discount,
                p.tax,
                p.closingStock stock,
                p.created
                -- i.img, i.imageId, -- Commented out to avoid duplicates for list view
            FROM product p
            -- LEFT JOIN images i on i.productId = p.productId AND i.is_main = TRUE -- If you have a 'main' image flag
            JOIN category c ON c.categoryId = p.categoryId
            WHERE
                IF(inCategoryId IS NOT NULL, c.categoryId = inCategoryId, TRUE) -- Corrected IF condition
                AND IF(inCustomerId IS NOT NULL, p.customerId = inCustomerId, TRUE) -- Corrected IF condition
            ORDER BY p.created DESC
            LIMIT inStart, inLimit;
            LEAVE PROC;

        -- Default case for unknown actions
        ELSE
            SELECT 'Out of actions' AS denoted;
            LEAVE PROC;

    END CASE;

END ;;
DELIMITER ;
